public class SKS_CNP_Setup extends FormRun
{
}

public void AcctApproval_chk()
{
    if(SKS_EFT_Setup_CNPAcctApproval.value())
    {
        SKS_EFT_Setup_CNPAccountApprGroup.enabled(true);
    }
    else
    {
        SKS_EFT_Setup_CNPAccountApprGroup.enabled(false);
    }
}

public void PostedPaymentRev_chk()
{
    if(SKS_EFT_Setup_CNPAllowPostedPmtJournal.value())
    {
        SKS_EFT_Setup_CNPRevJournalName.enabled(true);
        SKS_EFT_Setup_CNPRevPaymMode.enabled(true);
        SKS_EFT_Setup_CNPAutoPostJournal.enabled(true);
    }
    else
    {
        SKS_EFT_Setup_CNPRevJournalName.enabled(false);
        SKS_EFT_Setup_CNPRevPaymMode.enabled(false);
        SKS_EFT_Setup_CNPAutoPostJournal.enabled(false);
    }
}

public void activate(boolean _active)
{
    element.AcctApproval_chk();
    element.PostedPaymentRev_chk();

    SKS_EFT_Setup_CNPArchive.archivecheckbox_chk();


    SKS_EFT_Setup_CNPPeriodsRet.enabled(SKS_EFT_Setup.APPurgeFiles);
    super(_active);
}

public boolean canClose()
{
    boolean ret;
    SKS_EB_FileStorage  sks_EB_FileStorage;
    ;

    //BankFabric
    select firstonly sks_EB_FileStorage;

    if (sks_EB_FileStorage.StorageOption_APEFTFXDD == SKS_EB_BankIntegOptWithNoLicense::BankFabricEnumValue)
    {
        if(!SKS_EFT_Setup_CNPBankFabricFileLocation.valueStr())
        {
            Box::warning("@SKS253","@SKS225"); //required field

            SKS_EFT_Setup_CNPBankFabricFileLocation.setFocus();

            return false;
        }
    }
    else
    {
        if(SKS_EFT_Setup.CNPAcctApproval == NoYes::Yes && !SKS_EFT_Setup_CNPAccountApprGroup.valueStr())
        {
            Box::warning("@SKS253","@SKS225"); //required field

            SKS_EFT_Setup_CNPAccountApprGroup.setFocus();

            return false;
        }

        if(!SKS_EFT_Setup_CNPFileName.valueStr())
        {
            Box::warning("@SKS253","@SKS225"); //required field

            SKS_EFT_Setup_CNPFileName.setFocus();

            return false;
        }

        if(!SKS_EFT_Setup_CNPFilePath.valueStr())
        {
            Box::warning("@SKS253","@SKS225"); //required field

            SKS_EFT_Setup_CNPFilePath.setFocus();

            return false;
        }

        if(SKS_EFT_Setup_CNPArchive.value() && !SKS_EFT_Setup_CNPPathArchive.valueStr())
        {
            Box::warning("@SKS253","@SKS225"); //required field

            SKS_EFT_Setup_CNPPathArchive.setFocus();

            return false;
        }
    }

    ret = super();

    return ret;
}

