public boolean validateWrite()
{
    boolean ret;
    VendPaymModeTable   lVendPaymModeTable;
    SKS_EB_FileStorage  sks_EB_FileStorage;

    //BankFabric
    select firstonly sks_EB_FileStorage;

    if (sks_EB_FileStorage.StorageOption_APEFTFXDD == SKS_EB_BankIntegOptWithNoLicense::BankFabricEnumValue)
    {
        if(!SKS_EFT_Setup_CNPBankFabricFileLocation.valueStr())
        {
            Box::warning("@SKS253","@SKS225"); //required field

            SKS_EFT_Setup_CNPBankFabricFileLocation.setFocus();

            return false;
        }
    }
    else
    {
        if(SKS_EFT_Setup.CNPAcctApproval == NoYes::Yes && !SKS_EFT_Setup_CNPAccountApprGroup.valueStr())
        {
            Box::warning("@SKS253","@SKS225"); //required field

            SKS_EFT_Setup_CNPAccountApprGroup.setFocus();

            return false;
        }

        if(!SKS_EFT_Setup_CNPFileName.valueStr())
        {
            Box::warning("@SKS253","@SKS225"); //required field

            SKS_EFT_Setup_CNPFileName.setFocus();

            return false;
        }

        if(!SKS_EFT_Setup_CNPFilePath.valueStr())
        {
            Box::warning("@SKS253","@SKS225"); //required field

            SKS_EFT_Setup_CNPFilePath.setFocus();

            return false;
        }

        if(SKS_EFT_Setup_CNPArchive.value() && !SKS_EFT_Setup_CNPPathArchive.valueStr())
        {
            Box::warning("@SKS253","@SKS225"); //required field

            SKS_EFT_Setup_CNPPathArchive.setFocus();

            return false;
        }
    }

    if(SKS_EFT_Setup.CNPCommID == '')
    {
        warning("@SKS253","@SKS225"); //required field

        SKS_EFT_Setup_CNPCommID.setFocus();

        return false;
    }

    if(SKS_EFT_Setup.CNPAllowPostedPmtJournal == NoYes::Yes)
    {
        if(SKS_EFT_Setup.RevPaymMode == '')
        {
            warning("@SKS253","@SKS3012"); //required field

            SKS_EFT_Setup_CNPRevPaymMode.setfocus();

            return false;
        }

        if(SKS_EFT_Setup.CNPAutoPostJournal == NoYes::Yes)
        {
            select firstonly Paymstatus from lVendPaymModeTable where lVendPaymModeTable.PaymMode == SKS_EFT_Setup.CNPRevPaymMode;

            if(lVendPaymModeTable.PaymStatus != CustVendPaymStatus::None)
            {
                error("@SKS3014");

                return false;
            }
        }
    }

    ret = super();

    return ret;
    }

