public boolean validate()
{
    boolean ret;
    int thisval;
    System.Text.StringBuilder sb = new System.Text.StringBuilder();

    ;

    thisval = str2int(SKS_EFT_Setup_CNPPeriodsRet.valueStr());

    if(thisval < 2 )
    {
        sb.Append("@SKS239");
        sb.Replace('%1','2');
        Box::stop(sb.ToString(),"@SKS225"); //must be greater than 2

        SKS_EFT_Setup_CNPPeriodsRet.setFocus();

        return false;
    }

    ret = super();


    return ret;
}

